import React, {useState, useEffect} from 'react'
import './App.css';
import Nav from './Components/Nav';
import TransactionModule from './Components/Transaction_Module';



function App() {
  const [storeJson, setStoreJson] = useState([])
  const [transactions, settransactions] = useState([])
  const [uniqueDate, setUniqueDate] = useState([])


  useEffect(()=> {
    fetch('/api')
    .then(r=>r.json())
    .then(data=>{
      console.log(data)
    })  
},[])
  useEffect(()=> {
    fetch('/api/transaction')
    .then(r=>r.json())
    .then(data=>{
      settransactions(data)
    })  
  },[])
  return (
    <main>
    <Nav />
    <div className='home_wrapper'>
      <div className='accounts'>
        <div className='_wrapper'>
          <h2>Bank Name</h2>
          <div className='bank_id'>
            <h3 id = "bank_name">"Bank"</h3>
            <h3 id = "bank_logo">"Bank Logo"</h3>
          </div>
        </div>

      </div>

          <div className='transactions'>
          <div className='_wrapper'>  
          <p className="time">
             {uniqueDate}   
            </p>
            <h2 className='transaction_header'>Transactions</h2>

          <TransactionModule transactions = {transactions} dateSetterFunction = {setUniqueDate}/>
          </div>
        </div>
    </div>
    </main>
  )
}

export default App
